<style>
        body {
            font-family: Arial, sans-serif;
            margin: 0;
        }
        .header {
            display: flex;
            justify-content: space-between;
            padding: 10px 20px;
            background: #16181C;
            color: rgba(255, 255, 255, 0.95);
            font-size: 30px;
        }
        .list-container {
            display:flex;
            justify-content: space-around;
            padding-top: 50px;
        }

        .list-container ul {
            list-style: none;
            padding-left: 0;
        }

        .list-container li {
            border: 0.5px solid #EDEDED;
            border-radius: 16px;
            margin-bottom: 20px;
        }

        .list-item-container {
            display: flex;
            justify-content: space-between;
            width: 80vw;
            max-width: 500px;
            padding: 20px;
            background: #F4F4F5;
            border-radius: 16px;
            color: #16181C;
            text-decoration: none;
        }

        .list-item-right {
            display: flex;
            flex-direction: column;
            justify-content: space-between;
            align-items: flex-end;
        }

        .app-title {
            font-weight: bold;
            font-size: larger;
        }
.solobutton {
		    background-color: #eee;
		    border: 0.5px solid #EDEDED;
		  	border-radius: 8px;
		  	padding: 8px 8px;
		  	font-size: 14px;
		  	height:40px;
		}

		.solobutton:hover {
			 	cursor: pointer;
		    	color: #fff;
				background-color: #16181C;
		  		border-radius: 8px;
		  		padding: 8px 8px;
				border-color: #16181C;
		}
		
		.solobutton:active {
		  		opacity: 0.8;
				font-style: italic;
		}    </style></head>
